import React from "react";
import Carousel from "./components/carousel";
import CarouselItem from "./components/carouselItem";

const App: React.FC = () => {
  return (
    <div>
      <Carousel>
        <CarouselItem>
          <img src="your-image-url-1.jpg" alt="Item 1" />
        </CarouselItem>
        <CarouselItem>
          <img src="your-image-url-2.jpg" alt="Item 2" />
        </CarouselItem>
        <CarouselItem>
          <img src="your-image-url-3.jpg" alt="Item 3" />
        </CarouselItem>
      </Carousel>
    </div>
  );
};

export default App;
